window.bookSummaryJSON = "<p><b>When four college kids are buried alive and there’s only one way out, don’t ask questions. Just survive.&nbsp;</b></p> <p>After barely escaping a torturous series of undiscovered tunnels far beneath the Sierra foothills, Mae and her friends emerge, dehydrated and nearly dead from starvation.</p> <p>But everything Mae knows and loves is now gone.</p> <p>Through some bizarre tangle in time, they’ve been reeled back into the past. To a time that, according to Mae - “is constipated with antiquated gender inequality.”&nbsp;</p> <p>With danger lurking behind every tree and no easy way home, they must begin adapting to their new surroundings before it’s too late. So, when struck with an unexpected opportunity, Mae is faced with the difficult choice of returning to her own time or living out the greatest adventure of her life and carving her own path in history.</p> <p>Gin Westcott’s debut novel is the first in the unique Tangle of Time series that will take you through an exciting, historical, and romantic adventure that you won’t be able to put down.</p>"; 
